import React, { useState, useEffect } from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import IntlMessages from '../../../../../../util/IntlMessages';
import IconButton from '@material-ui/core/IconButton';
import EditGroupes from './EditGroupes';
import _ from 'lodash';
import GroupesItem from './GroupesItem';
import DeleteGroupes from './DeleteGroupes';
import { connect } from 'react-redux';
import { deleteGroup, editGroup } from '../../../../../../actions/GroupsAction';
class GroupesList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false,
      item: {},
      deleteIsopen: false,
      deleteItem: {},
      group: '',
      classID: '',
      id: '',
      status: true,

      //   namelevel: "",
      //   fk_id_education_type_v4:'',
      //   id: null,
    };
    this.handleAnnule = this.handleAnnule.bind(this);
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    // this.handleToggle = this.handleToggle.bind(this);
    this.handleEdit = this.handleEdit.bind(this);
    this.handleCancel = this.handleCancel.bind(this);
    this.handleDelete = this.handleDelete.bind(this);
    this.handleDeleteGroup = this.handleDeleteGroup.bind(this);
  }
  handleChange = (name) => (event) => {
    this.setState({ [name]: event.target.value });
  };
  //   handleToggle() {
  //     this.handleCancel();
  //   }
  handleSubmit = (e) => {
    e.preventDefault();

    const data = {
      name: this.state.group,
      id: this.state.id,
      fk_id_class: this.state.classID,
      status: this.state.status,
    };
    this.props.editGroup(data);
    this.handleCancel();
  };
  handleDeleteGroup = (event) => {
    console.log('EEEEEEEEEEEEEEEEEE');
    event.preventDefault();
    this.props.deleteGroup(this.state.deleteItem);
    this.setState({
      deleteIsopen: false,
    });
  };
  handleAnnule = () => {
    this.handleCancel();
  };
  handleCancel = () => {
    this.setState({
      isOpen: false,
      deleteIsopen: false,
      group: '',
      classID: '',
      id: '',
      status: true,
    });
  };

  handleEdit = (item, event) => {
    event.preventDefault();
    this.setState({
      isOpen: true,
      id: item.id,
      group: item.name,
      status: item.status,
      classID: item.fk_id_class,
    });
  };
  handleDelete = (item, event) => {
    console.log('MMMMMMMMMMMMMMMM');
    event.preventDefault();
    this.setState({ deleteIsopen: true, deleteItem: item });
  };

  render() {
    return (
      <div className="table-responsive-material">
        <div>
          <h1>
            <b>
              <IntlMessages id="list.groupe" />
            </b>
          </h1>
        </div>
        <Table className="default-table table-unbordered table table-sm table-hover">
          <TableHead className="th-border-b">
            <TableRow>
              <TableCell>
                {' '}
                <IntlMessages id="sidebar.components.groupes" />
              </TableCell>

              <TableCell>
                <IntlMessages id="sidebar.components.class" />
              </TableCell>
              <TableCell>
                <IntlMessages id="action.subject.module" />
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {this.props.groupsList.length == 0
              ? ''
              : this.props.groupsList.map((groupItem) => {
                  return (
                    <GroupesItem
                      archived={false}
                      groupItem={groupItem}
                      handleEdit={this.handleEdit}
                      handleDelete={this.handleDelete}
                      //   educationTypes={this.props.educationTypes}
                    />
                  );
                })}
          </TableBody>
        </Table>
        {this.state.isOpen ? (
          <EditGroupes
            // levels={this.state.item}
            closeModal={this.handleCancel}
            isOpen={this.state.isOpen}
            values={this.state}
            // educationTypes={this.props.educationTypes}
            handleAnnule={this.handleAnnule}
            handleChange={this.handleChange}
            handleSubmit={this.handleSubmit}
            // handleToggle={this.handleToggle}
          />
        ) : (
          ''
        )}
        {this.state.deleteIsopen === true ? (
          <DeleteGroupes
            handleDeleteGroup={this.handleDeleteGroup}
            deleteItem={this.state.deleteItem}
            handleCancel={this.handleCancel}
            deleteIsopen={this.state.deleteIsopen}
          />
        ) : (
          ''
        )}
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    // levels: state.levelsReducer.levels,
  };
}

export default connect(
  mapStateToProps,

  { editGroup, deleteGroup }
)(GroupesList);
